<h1 id="Wine-Quality">Wine Quality<a class="anchor-link" href="#Wine-Quality">&#182;</a></h1><p>This notebook is an example on how to use the Vertica ML Python Library. We will use the Wine Quality dataset to predict a specific white wine quality. You can download the Jupyter Notebook of the study by clicking <a href="winequality.ipynb">here</a>. To achieve our goals, we have access to the following data.</p>
<p><ul class="ul_content">
    <li><b>fixed acidity</b></li>
    <li><b>volatile acidity</b></li>
    <li><b>citric acid</b></li>
    <li><b>residual sugar</b></li>
    <li><b>total sulfur dioxide</b></li>
    <li><b>free sulfur dioxide</b></li>
    <li><b>density</b></li>
    <li><b>pH</b></li>
    <li><b>sulphates</b></li>
    <li><b>alcohol</b></li>
    <li><b>quality (score between 0 and 10)</b></li>
</ul></p>
<p>We will follow the entire Data Science cycle (Data Exploration - Data Preparation - Data Modeling - Model Evaluation - Model Deployment) and solve this easy use-case. The purpose is to show you some of the library interesting functionalities.</p>
