<div class="text_cell_render border-box-sizing rendered_html">
<p>As we are facing wine tasters score, it is highly probable that two wines having a close composition will get almost the same score. With this logic KNN will be a very good model for this study. However KNN is sensible to un-normalized data. We must normalize the data before applying the model.</p>

</div>
