<div class=" highlight hl-ipython3"><pre><span></span><span class="n">winequality</span><span class="o">.</span><span class="n">normalize</span><span class="p">([</span><span class="s2">&quot;free_sulfur_dioxide&quot;</span><span class="p">,</span> 
                       <span class="s2">&quot;residual_sugar&quot;</span><span class="p">,</span> 
                       <span class="s2">&quot;pH&quot;</span><span class="p">,</span> 
                       <span class="s2">&quot;sulphates&quot;</span><span class="p">,</span> 
                       <span class="s2">&quot;volatile_acidity&quot;</span><span class="p">,</span> 
                       <span class="s2">&quot;fixed_acidity&quot;</span><span class="p">,</span>
                       <span class="s2">&quot;citric_acid&quot;</span><span class="p">,</span>
                       <span class="s2">&quot;chlorides&quot;</span><span class="p">,</span>
                       <span class="s2">&quot;total_sulfur_dioxide&quot;</span><span class="p">,</span>
                       <span class="s2">&quot;alcohol&quot;</span><span class="p">],</span>
                      <span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;robust_zscore&quot;</span><span class="p">)</span>
</pre></div>

</div>
